import {combineReducers, configureStore} from "@reduxjs/toolkit";
import {inCartReducer} from "../inCart";
import {inCart} from "./toolkitReducer";


const rootReducer = combineReducers({
    inCart: inCart
})

export const storeTest = configureStore({
    reducer: rootReducer,
})
